import React, { useRef, useState } from "react";
import { Route, NavLink, Switch, Redirect } from "react-router-dom";
import classNames from 'classnames/bind';
import img_bg from '../Image/bg_3.png'
import styles from '../CSS/main.module.css';


let cx = classNames.bind(styles);

const Home = () => {
    return (
        <div className={cx('home')}>
            <div className={cx('content-home')}>
                <h3>Cung cấp dịch vụ giải trí dành cho bạn</h3>
                <div className={cx('home-content')}>
                    Bạn muốn trả nghiệm cảm giác nhập vai, làm chủ đường phố, sở hưu những model phương tiện cực tuyệt. Hãy tham gia ngay với chúng tôi.
                </div>
                <div className={cx('button')}>
                    <button>Tham gia</button>
                </div>
            </div>
            <div className={cx('img-home')}>
                <img src={img_bg} />
            </div>
        </div>
    )
}
export default Home
